/* harmony default export */ __webpack_exports__["default"] = ("<!-- This page is hard coded with example text.\r\n   In real life, it will get its content via data binding  -->\r\n\r\n<div class=\"container\">\r\n\r\n  <div  [hidden]=\"location\" class=\"subhead\">\r\n    (Select Location) <br/><br/>\r\n  </div>\r\n\r\n  <span *ngIf=\"location=='Boothbay Harbor'\">\r\n\r\n   <div class=\"subhead\">BBH Boards and Committees</div>\r\n    <ul>\r\n      <li>Board of Appeals</li>\r\n      <li>Board of Selectmen</li>\r\n      <li>Boothbay Harbor Sewer District</li>\r\n      <li>Boothbay Region Water District</li>\r\n      <li>Budget Committee</li>\r\n      <li>Cemetery District Trustees-BBH</li>\r\n      <li>Planning Board</li>\r\n      <li>Port Committee</li>\r\n      <li>Refuse District</li>\r\n      <li>School Committee Members -BBH</li>\r\n      <li>School District Trustees-BBH</li>\r\n      <li>Shellfish Committee</li>\r\n    </ul>\r\n\r\n    <div class=\"subhead\">Board of Selectmen</div>\r\n    <table>\r\n      <tr> <td>Till year</td> <td>Name</td> <td>Position</td> </tr>\r\n      <tr> <td>2020</td> <td>Denise Griffin</td> <td></td> </tr>\r\n      <tr> <td>2020</td> <td>Tricia Warren</td> <td>Vice Chair</td> </tr>\r\n      <tr> <td>2021</td> <td>Wendy Wolf</td> <td></td> </tr>\r\n      <tr> <td>2022</td> <td>Kenneth Fitch</td> <td></td> </tr>\r\n      <tr> <td>2022</td> <td>Michael Tomko</td> <td>Chair</td> </tr>\r\n    </table>\r\n\r\n    [ From town website ]\r\n\r\n  </span>\r\n\r\n\r\n<div *ngIf=\"location=='Lincoln County'\">\r\n  <div class=\"subhead\">Board of Commissioners</div>\r\n  <span>\r\n  The Board of Commissioners meets on the first and third Tuesdays of each Month starting at 9:00 A.M. in the Hearing Room at the Courthouse in Wiscasset.  Additional Meetings are held when needed and during the preparation of the Budget.\r\n  </span><br/><br/>\r\n  ​\r\n  District One: Commissioner Hamilton Meserve<br/>\r\n  (Term Expires 12-31-2020)<br/>\r\n  Boothbay, Boothbay Harbor, Edgecomb, Southport, Westport Island, Wiscasset<br/>\r\n  <br/>\r\n  District Two: Commissioner William B. Blodget<br/>\r\n  (Term Expires 12-31-2022)<br/>\r\n  Bremen, Bristol, Monhegan Plantation, Nobleboro, South Bristol, Waldoboro<br/>\r\n  <br/>\r\n  District Three: Commissioner Mary Trescot (chair)<br/>\r\n  (Term Expires 12-31-2020)<br/>\r\n  Alna, Damariscotta, Dresden, Jefferson, Newcastle, Somerville, Whitefield and Hibberts Gore<br/><br/>\r\n  [From Lincoln County website]\r\n\r\n</div>\r\n\r\n\r\n<div *ngIf=\"location=='State of Maine'\">\r\n  <div class=\"subhead\">{{location}} Political Structure</div>\r\n<p>\r\n  The Maine Constitution structures Maine's state government, composed of three co-equal branches—the executive, legislative, and judicial branches. The state of Maine also has three Constitutional Officers (the Secretary of State, the State Treasurer, and the State Attorney General) and one Statutory Officer (the State Auditor).\r\n</p>\r\n<p>\r\n  The legislative branch is the Maine Legislature, a bicameral body composed of the Maine House of Representatives, with 151 members, and the Maine Senate, with 35 members. The Legislature is charged with introducing and passing laws.\r\n</p>\r\n<p>\r\n  The executive branch is responsible for the execution of the laws created by the Legislature and is headed by the Governor of Maine (currently Janet Mills). The Governor is elected every four years; no individual may serve more than two consecutive terms in this office. The current attorney general of Maine is Aaron Frey. As with other state legislatures, the Maine Legislature can by a two-thirds majority vote from both the House and Senate override a gubernatorial veto. Maine is one of seven states that do not have a lieutenant governor.\r\n</p>\r\n<p>\r\n  The judicial branch is responsible for interpreting state laws. The highest court of the state is the Maine Supreme Judicial Court. The lower courts are the District Court, Superior Court and Probate Court. All judges except for probate judges serve full-time, are nominated by the Governor and confirmed by the Legislature for terms of seven years. Probate judges serve part-time and are elected by the voters of each county for four-year terms.   [From Wikipedia]\r\n</p>\r\n</div>\r\n\r\n\r\n\r\n\r\n  <div *ngIf=\"location=='Austin'\">\r\n      [From Wikipedia] Austin is administered by an 11-member city council (10 council members elected by geographic district plus a mayor elected at large). The council is accompanied by a hired city manager under the manager-council system of municipal governance. Council and mayoral elections are non-partisan, with a runoff in case there is no majority winner. A referendum approved by voters on November 6, 2012 changed the council composition from six council members plus a mayor elected at large to the current \"10+1\" district system. November 2014 marked the first election under the new system. The Federal government had forced San Antonio and Dallas to abandon at-large systems before 1987; however, the court could not show a racist pattern in Austin and upheld the city's at-large system during a 1984 lawsuit. In five elections between 1973 and 1994 Austin voters rejected single-member districts.[240]\r\n  </div>\r\n\r\n\r\n  <div *ngIf=\"location=='Travis County'\">\r\n      [From Wikipedia] Like other Texas counties, Travis County is governed by a Commissioners' Court composed of the county judge and four county commissioners. The court levies county taxes and sets the budgets for county officials and agencies. The judge and commissioners are elected for four-year terms (the judge at-large, and the commissioners from geographic precincts). The other major county-wide official is the county clerk, who maintains the county's records, administers elections, and oversees legal documentation (such as property deeds, marriage licenses and assumed name certificates). The clerk is also elected at-large for a four-year term.\r\n    <p>\r\n  The Heman Marion Sweatt Travis County Courthouse is located in downtown Austin. The county courthouse holds civil and criminal trial courts and other functions of county government. As of 2017, the county's probate courts are in the process of being moved from the county courthouse into Austin's 1936 United States Courthouse, which was acquired by the county in 2016.[19]\r\n   </p>\r\n    </div>\r\n\r\n\r\n  <div *ngIf=\"location=='State of Texas'\">\r\n      [From Wikipedia]  Texas has a plural executive branch system limiting the power of the governor,\r\n      which is a weak executive compared to some other states. Except for the Secretary of State,\r\n      voters elect executive officers independently; thus candidates are directly\r\n      answerable to the public, not the governor.[140] This election system has led\r\n      to some executive branches split between parties and reduced the ability of the\r\n      governor to carry out a program. When Republican President George W. Bush\r\n      served as Texas's governor, the state had a Democratic lieutenant governor,\r\n      Bob Bullock. The executive branch positions consist of the Governor,\r\n      Lieutenant Governor, Comptroller of Public Accounts, Land Commissioner,\r\n      Attorney General, Agriculture Commissioner, the three-member\r\n      Texas Railroad Commission, the State Board of Education, and the Secretary of State.[140]\r\n    <p>\r\n      The bicameral Texas Legislature consists of the House of Representatives, with 150 members,\r\n      and a Senate, with 31 members. The Speaker of the House leads the House, and the lieutenant governor,\r\n      the Senate.[141] The Legislature meets in regular session biennially for just over 100 days,\r\n      but the governor can call for special sessions as often as desired (notably,\r\n      the Legislature cannot call itself into session).[142]\r\n      The state's fiscal year spans from the previous calendar year's September 1\r\n      to the current year's August 31. Thus, the FY 2015 dates from September 1,\r\n      2014 through August 31, 2015.\r\n    </p>\r\n  </div>\r\n\r\n\r\n  <div *ngIf=\"location=='United States'\">\r\n      The United States is the world's oldest surviving federation. It is a representative democracy, \"in which majority rule is tempered by minority rights protected by law\".[374] The government is regulated by a system of checks and balances defined by the U.S. Constitution, which serves as the country's supreme legal document.[375] For 2018, the U.S. ranked 25th on the Democracy Index[376] and 22nd on the Corruption Perceptions Index.[377]\r\n    <p>\r\n    In the American federalist system, citizens are usually subject to three levels of government: federal, state, and local. The local government's duties are commonly split between county and municipal governments. In almost all cases, executive and legislative officials are elected by a plurality vote of citizens by district. There is no proportional representation at the federal level, and it is rare at lower levels.[378]\r\n    </p>\r\n    The federal government comprises three branches:\r\n    <ul>\r\n      <li>\r\n        Legislative: The bicameral Congress, made up of the Senate and the House of Representatives, makes federal law, declares war, approves treaties, has the power of the purse,[379] and has the power of impeachment, by which it can remove sitting members of the government.[380]\r\n      </li>\r\n      <li>Executive: The president is the commander-in-chief of the military, can veto legislative bills before they become law (subject to Congressional override), and appoints the members of the Cabinet (subject to Senate approval) and other officers, who administer and enforce federal laws and policies.[381]\r\n        Judicial: The Supreme Court and lower federal courts, whose judges are appointed by the president with Senate approval, interpret laws and overturn those they find unconstitutional.[382]\r\n      </li>\r\n    </ul>\r\n    [From Wikipedia]\r\n  </div>\r\n\r\n  <div *ngIf=\"agency=='Glendale HOA'\">\r\n    <h3>Board of Directors</h3>\r\n    <p>\r\n      Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse porttitor arcu mi, eu mattis magna posuere pulvinar. Nulla lacinia facilisis ipsum, ut ornare urna fermentum et. Aliquam sit amet ipsum ac eros mattis interdum. Nunc diam purus, tempus et eleifend quis, sagittis sed nunc. Vivamus rutrum lacinia ipsum nec molestie. Donec eu ex sed lectus semper congue. Sed non volutpat eros. Curabitur eu porta augue.\r\n\r\n      Nulla dictum risus ut molestie semper. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed ante elit, imperdiet eu venenatis id, mattis vel odio. Ut id fermentum nisl, et mattis ante. Vivamus posuere suscipit lobortis. Fusce et sem eget neque elementum ullamcorper. Nulla ligula felis, vestibulum id nulla rhoncus, mollis malesuada eros.\r\n    </p>\r\n    <h3>Covenance Committee</h3>\r\n    <p>\r\n      Curabitur consequat egestas sapien non fringilla. Vestibulum at vestibulum lacus. Pellentesque tempus purus sollicitudin, scelerisque elit suscipit, cursus metus. Aenean vestibulum erat ex. In viverra sapien quis felis mollis, sed porttitor mauris venenatis. Maecenas sit amet condimentum tortor, nec interdum sapien. Duis scelerisque, purus eget accumsan placerat, magna orci ultrices augue, eget pretium quam risus quis ante\r\n    </p>\r\n    <h3>Governing Documents</h3>\r\n    <p>\r\n      Nullam vehicula lectus vel urna elementum dapibus. Proin pulvinar enim orci, ut consectetur turpis congue quis. Sed id malesuada mi. Cras a risus purus. Vivamus accumsan sollicitudin purus in lobortis. Nam dapibus eget neque in tempor. Cras tristique pellentesque iaculis. Phasellus non mi ipsum. Maecenas at pulvinar dolor. Sed pretium diam nec lacus consectetur feugiat. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Vivamus quis magna suscipit, imperdiet orci ac, luctus quam.\r\n    </p>\r\n  </div>\r\n\r\n</div>\r\n");

